    data: |
      SELECT + 75 + - col0 FROM tab1 (FORMAT parquet) WHERE NULL NOT BETWEEN - - 28 / - CAST ( - + ( + col0 ) AS INTEGER ) AND col2 - col0 * - col1;
  - name: tab1

outputs:
  - name: q11181.out
    data: |
